//EMA calculation
function calculateEMA(periods, price, previousEMA) {
    let k = 2 / (periods + 1)
    return price * k + previousEMA * (1-k)
}

let candle = record.current
let L = 144
let S = 3

//reinit of the sums for average and standard deviation
variable.sqL = 0
variable.sqS = 0
variable.sumL = 0
variable.sumS = 0

//Fetch candles on L and S periods
variable.lastCandleL.push(candle.close)
if(variable.lastCandleL.length > L){
	variable.lastCandleL.splice(0,1)
}

variable.lastCandleS.push(candle.close)
if(variable.lastCandleS.length > S){
	variable.lastCandleS.splice(0,1)
}

//moving average for L and S periods
if(variable.lastCandleL.length === L){
for(var i = 0; i < L; i++){
	variable.sumL += variable.lastCandleL[i]
}
variable.avgL = variable.sumL / L
}
else {
	variable.avgL = candle.close
}

if(variable.lastCandleS.length === S){
for(var i = 0; i < S; i++){
	variable.sumS += variable.lastCandleS[i]
}
variable.avgS = variable.sumS / S   
}else{
	variable.avgS = candle.close
}

//Standard deviation for L and S
if(variable.lastCandleL.length === L){
for(var i = 0 ; i < L ; i++){
	variable.sqL += Math.pow(variable.lastCandleL[i] - variable.avgL, 2)
}
variable.sigL = Math.sqrt(variable.sqL / L)
}else{
	variable.sigL = variable.avgL * 0.01
}

if(variable.lastCandleS.length === S){
for(var i = 0 ; i < S ; i++){
	variable.sqS += Math.pow(variable.lastCandleS[i] - variable.avgS, 2)
}
variable.sigS = Math.sqrt(variable.sqS / S)
}else{
	variable.sigS = variable.avgS * 0.01
}

//alpha calculation
variable.alpha = variable.sigS / variable.sigL * 0.2
if(variable.alpha === undefined || isNaN(variable.alpha)){
	variable.alpha = 1
}

//Previous VAMA initialization
if(variable.previousVAMA === undefined){
		variable.previousVAMA = candle.close
}

//VAMA calculation
variable.vama = variable.alpha * candle.close + (1 - variable.alpha) * variable.previousVAMA
if(variable.vama === undefined || isNaN(variable.vama)){
	variable.vama = candle.close
}
variable.previousVAMA = variable.vama

if(candle.close > variable.vama){
	variable.trend = 1
}else{
	variable.trend = -1
}
